import React, {Component} from "react"
class Filmovi extends Component{
    
    constructor(){
        super()
        this.state = {
            filmovi: []
        }
    }
    
    componentDidMount(){
        let headers=new Headers();

        headers.append('Content-Type', 'application/json');
        headers.append('Accept', 'application/json');

        const config={
            method: 'GET',
            mode: "no-cors",
            headers: headers
        }

        fetch('http://localhost:8080/bioskop/filmovi', config)
            .then(response => response.text())
            .then((data) => {
                resolve(data ? JSON.parse(data) : {})
            })
            .catch((error) => {
                reject(error)
              })
            .then(response => {
                const {data} = response.data
                console.log("Podaci: "+data)
                this.setState({
                    filmovi: data
            })
        })
    }

    render(){
        const prikaz=(this.state.filmovi.length === 0) ? <h1>Nema jos ni jednog filma</h1>:<h1>Ima filmova</h1>
        return(
            prikaz
        )
    }

}

